        shipDots[1].setFill(values[base + 1]);
        shipDots[2].setFill(values[base + 1]);
        
        layer.add(ships[x]);
      }

      stage.add(layer);

      var thrusterZero = 8.3 / 19.3;
      var twoPi = 2 * Math.PI;
      var gameTime = 0;
      var startBase = (1 + (numShips * 4));
      var anim = new Kinetic.Animation(function(frame) {
        var time = frame.time,
            timeDiff = frame.timeDiff,
            frameRate = frame.frameRate;
        for (var x = 0; x < numShips; x++) {
          var tickBase = ((gameTime * numShips) + x) * 5;
          var shipHexX = values[startBase + tickBase];
          var shipHexY = values[startBase + tickBase + 1];
          var thrusterAngleHex = values[startBase + tickBase + 2];
          var thrusterForceHex = values[startBase + tickBase + 3];
          var energyHex = values[startBase + tickBase + 4];
          var energy = parseInt(energyHex, 16) / 10;
          if (energy == 0) {
            ships[x].hide();
          } else {
            ships[x].show();
            ships[x].setX(parseInt(shipHexX, 16) / 10);
            ships[x].setY(800 - parseInt(shipHexY, 16) / 10);
            var thruster = ships[x].getChildren()[0];
            thruster.setRotation(
                Math.PI + (twoPi - (parseInt(thrusterAngleHex, 16) / 100)));
            var forceFactor = parseInt(thrusterForceHex, 16) / 100;
            if (forceFactor < 0.0001) {
              thruster.setScale(0);
            } else {
              thruster.setScale(thrusterZero + (forceFactor * (1 - thrusterZero)));
            }

            ships[x].getChildren()[2].setScale(energy / 100, 1);
            var shipDotGroup = ships[x].getChildren()[4];
            shipDotGroup.setRotation(
                shipDotGroup.getRotation() + (shipRotation * shipOrbits[x]));
          }
        }
        gameTime++;
        var scale = Math.min(window.innerWidth / stage.getWidth(),
                             window.innerHeight / stage.getHeight());
        stage.setScale(Math.min(1, scale, scale));
      }, layer);

      anim.start();

    </script>
  </body>
</html>
